【送料込み！父の日ギフトにもおすすめ！本牛革を使用。タリアンレザー×ボンデッドレザーで仕上げた贅沢仕様。圧倒的な収納力を誇る長財布。】<br><br>

外面にイタリアンレザー(フルベジタブルタンニン鞣し)と、内面にドイツの老舗サラマンダー社のボンデッドレザーを<br>
使用した最高峰のラウンドレザーウォレットです。<br>




イタリアンレザーが最高峰と呼ばれる由縁は、イタリアのトスカーナ地方で<br>
昔から革を鞣す技術が発達し、代表的工芸品にレザー製品が挙げられるほど、<br>
その歴史が古く品質も郡を抜いていることからきています。<br>
この地域には現在でも数多くのタンナーが存在し、その高品質な製品は<br>
さまざまな高級ブランドの皮革製品などに採用されています。<br>
イタリアンレザーは、非常に味わい深い素材感が特徴のレザーが<br>
多いといわれていますが、中でも最近日本でも注目されている、<br>
鞣し過程でオイルを多く含ませ経年変化による表現が楽しめる<br>
上品なしわとしなやかさが特徴の、成牛のショルダーを植物タンニンで<br>
鞣したブッテーロを得意とするワルピエ社などが有名です。<br>




本製品はpelle conciata al vegetaleに承認されたイタリアンレザーを使用しています。<br><br>





シンプルな設計で実用性の幅が広いことでも人気のラウンド長財布。<br>
大きく3つに仕切られた多機能ポケットには、お札はもちろんのこと、<br>
パスポートなどのちょっとした小物も収納可能となっています。<br>


その3つのポケットの丁度真ん中仕切り部分にはジップファスナー式の<br>
コインケースがあり小銭も十分に収納することが可能です。<br>


また、カードポケットも両側均等に合計１２箇所配置されていますので、<br>
使い勝手の良さに、機能性も兼ねそろえた万能財布といえる製品に仕上がっています。<br>


内面、外面共にファスナーはＹＫＫ社製のメタルジップを採用していますので、<br>
耐久性もあって永年にわたり安心してお使い頂けます。<br><br>

<br>
